import './App.css';
import {Link} from 'react-router-dom'

function Nav() {
  return (
    <nav>
        <h3>Logo</h3>
            <ul className="nav-Links">
                <Link to="/">
                <li>Home</li>
                </Link>
                <Link to="/itinerary">
                <li>Itinerary</li>
                </Link>
                <Link to="/about">
                <li>About</li>
                </Link>

            </ul>
    </nav>
  );
}

export default Nav;
